import React from "react";
import "../css/home.css";

const Header = () => {
  return (
    <div id="headerFlexContainer">
      <h1 id="headerTitle">AZERTYPE</h1>
      <h2 id="headerFocus">L'application pour écrire plus vite !</h2>
      <p id="headerDescription">
        AzerType est une application en ligne pour apprendre à taper plus vite
        au clavier
      </p>
    </div>
  );
};

export default Header;
